class Solution {

    /**
     * @param Integer[] $nums1
     * @param Integer[] $nums2
     * @param Integer $x
     * @return Integer
     */
    function minimumTime($nums1, $nums2, $x) {
        $n = count($nums1);
        $prefixSum = array_fill(0, $n + 1, 0);
        for ($i = 0; $i < $n; $i++) {
            $prefixSum[$i + 1] = $prefixSum[$i] + $nums1[$i];
        }
        $result = PHP_INT_MAX;
        $suffixSum = 0;
        for ($i = $n - 1; $i >= 0; $i--) {
            $suffixSum += $nums1[$i];
            $left = 0;
            $right = $i;
            while ($left <= $right) {
                $mid = $left + (($right - $left) >> 1);
                $currentSum = $prefixSum[$mid] + $suffixSum + ($n - 1 - $i + $mid) * $nums2[$i];
                if ($currentSum <= $x) {
                    $result = min($result, $n - 1 - $i + $mid);
                    $right = $mid - 1;
                } else {
                    $left = $mid + 1;
                }
            }
            $suffixSum -= $nums2[$i];
        }
        return $result === PHP_INT_MAX ? -1 : $result;
    }
}
